import React from 'react';
import ReactDOM from 'react-dom';
import * as serviceWorker from '../serviceWorker';
import withConnect from '../components/withConnect';
import PhoneticTranscription from '../components/phonetic-transcription';
import { methods, samplePayload } from '../components/phonetic-transcription/payload';
import { AnnotationType } from '../types';

const SpeechAnalysisComp: React.FC = withConnect({ type: AnnotationType.PHONETIC_TRANSCRIPTION, methods, samplePayload })(PhoneticTranscription);

ReactDOM.render(
  <SpeechAnalysisComp />,
  document.getElementById('root'),
);

serviceWorker.unregister();
